&quot;If your memory returns, I can't be with you anymore&quot;

Tomohisa and Yuuta live peacefully on a small island in Seto Inland Sea. Yuuta's lost memory of the past and regressed to an infant-like state, but for some reasons, Tomohisa doesn't want him to regain his memory and continues on living while hiding from something. In a closed-off world, Tomohisa, immersed in a distorted happiness, seems to always see the trace of &quot;someone&quot; in Yuuta&hellip;?

A lover and guardian seme x an amnesiac, infant-like uke.

&quot;Work is so hard... I just want to be at peace...&quot;
When a corporate slave on the verge of breaking down encounters a beautiful girl searching for blood...
Is this what I was waiting for... A blissful death?
&quot;What? You want to be killed? I just want some blood.&quot;
&quot;Eeeehhhh, you must be kidding me!&quot;
Today, tomorrow, and the future ahead, I want to live because I want to be killed by you!
A fateful, life-or-death romantic comedy!

Aikawa Eri dies in a traffic accident after staying up all night playing an otome game. She reincarnates as Eris, the villainess of her favorite game. In order to avoid the bad end, she tries her best to change the story, but as expected, it&rsquo;s hard to rewrite fate&hellip;

She is abandoned by the prince. Even more, her life almost ends when she is attacked by a gang of thugs, but a young man appears&hellip;

Will the antisocial prince change her destiny? This is the reincarnated villainess&rsquo;s rebirth romance fantasy!
