Amane Fujimiya&rsquo;s neighbor in the apartment he lives in is the school&rsquo;s number one lovable angel: Excellent and with a level of beauty that can only be described as angelic &ndash; Mahiru Shiina. Amane, an ordinary student who doesn&rsquo;t stand out, is her neighbour, but until now, they didn&rsquo;t interact with each other. After meeting the soggy angel in the rain: 

&ldquo;I&rsquo;m returning what I borrowed. By the way, clean up your room. It&rsquo;s filthy.&rdquo; 
&ldquo;None of your business.&rdquo; 

A relationship with a slightly sharp-tongued angel begins, starting with handing over an umbrella. From catching a cold and having someone take care of you, to making a meal for someone because they neglected their health, to joint work (cleaning rooms)&hellip;'

This is a short comic intended to only introduce the light novel. The serialization of the actual manga will be done by 三描子 and 優木すず.

What on earth must one do, in order to bag the most popular childe in the entire school?

Should I act like a gentle beauty? Or should I be enthusiastic and bold?
Should I pretend to be a Cinderella and play hard to get, or should I disguise myself as an aristocrat,and take the initiative?

Nina said: &quot;These are all not worth mentioning! Isn't it better to become the queen of the school? If he acts like a tsundere? Just give him a good beating!&quot;

But the childe said: &quot;Miss, please just let me go! I just want to lie in a corner and become a corpse that nobody pays attention to!&quot;

Nina: &quot;Hmph, acting so pampered and arrogant just because I like you? This Cinderella is not a vegetarian!&quot;

[i]Note: (Chinese Slang) Vegetarian = Easily bullied
Not a Vegetarian = Not to be trifled with[/i]

We&rsquo;ve been together since we were kids...

But then you left me without warning.

&ldquo;I&rsquo;m here from the future to save you.&rdquo;

Murder Inc. A notorious hit group whose existence itself is veiled, boasts considerable power among the mafia with their perfect workmanship.

{I will catch them.}

In order to get those fucking psychopaths with my own hands, I decided to enter the killers' den. I will avenge sunbae. 

Simone, a third-year wheelman for Murder Inc. and an undercover detective.

&quot;Lately, every time you see me... You have a hungry look in those eyes.&quot;
&quot;Is it that obvious?&quot;
&quot;Why are you acting so naive? You don't need to.&quot;

Murder Inc.'s boss and the best hitman, codename Mr. Nero&mdash;Eugene.

&quot;Don't let your guard down. You never know when you're gonna be shot dead.&quot;
&quot;You're the one that should be careful. Maybe a bullet will hit the back of your head.&quot;

Before he was able to finish his sentence, Simone tilted his head and kissed Eugene.
His tongue naturally came into his mouth and settled down, like a snake coiling up.

A relationship that has been kept hidden.

In the darkness that cannot bring happiness, the two gradually colored the world for each other.

&quot;The wonderful memories of childhood will usually make you regret taking it for granted!&quot;

Ke Pinyi, who excels at academics and serves as class president, is nicknamed an iceberg because of her serious personality which causes people to find it difficult to get close to her. But in reality, she is a girl who likes to read shoujo manga and fantasize.

One day, she accidentally witnesses the confession of a classmate at school, and her secret of reading mangas was discovered! What's even more surprising is that this person was actually her childhood friend who went abroad when she was a child&mdash;Guan Yuxia...

I reincarnated as the wife of a cursed archduke in my own twisted novel. As the author, I took responsibility and set things right by lifting the curse, which was the key to returning home. I thought my job was done, and just when I was finally trying to go back, the archduke asked me, &quot;Did you really think I wouldn't know that you&rsquo;re planning on returning to your fiance?&quot;

He had completely misunderstood!

&quot;Whether you like it or not, I'm still your husband. I'm never letting you go back to that bastard.&quot;

All I want is for him to please let me go home!

I wish for an ephemeral &ldquo;happiness&rdquo;&hellip;

Despite being born into a family with unusual powers in its bloodline, Saimori Miyo had not inherited any special abilities. Moreover, she was treated like a lowly servant by her half-sister, who in an ironic twist of fate had awakened an ability of her own. Unloved by her parents and shunned by all, Miyo was a forgotten daughter. Even her childhood friend, her one and only ally, chose to marry her half-sister in order to take over the estate. Seen as nothing more than a hindrance, Miyo is married off to the Kudou family. To a man rumored to be cold and ruthless&hellip;

Adapted from a light novel! Japanese-style fantasy x Marriage. A story of love blossoming from marriage.

&quot;I'm straight, so why would I be entangled in this mess with three male suitors?!&quot; Because of an obnoxious ad for a game, the main character, Lu Xing, accidentally enters the world of an otome game. In order to return, he must gain the affection of three male characters?! The aloof lord, the mysterious assassin, the gentle royal guard -- who will be his final pick? The survival of a straight man begins now&hellip;

