I couldn't believe what happened before my eyes. 
&quot;Sister, what is 'this'?&quot;
&quot;It's your new friend, you said you needed a new friend no?&quot;
One day my sister picked up a man. It's astounding to just &quot;pick up a man,&quot; but the more shocking fact is that this man&hellip; In a palace battle, he lost his memory. By day he was a child but by night he was an adult man.
&quot;I wish I was always in pain&quot;
&quot;Huh? Why?&quot;
&quot;Because Amy is always by my side.&quot;
Why is this guy dangerous? In the morning, he's a cute and lovable puppy&hellip;
[hr]The main character reincarnates into a side character of a novel that she had once read. She becomes Amy, a young landlord, who has an older sister. From what she recalls in the original novel, her sister becomes the first love of the male lead she picked up and gets brutally murdered in the near future. The male protagonist has a disposition that of a sociopath, which stemmed from the unloved environment he grew up in. He has also been inflicted with a curse, where his body and mind would transform into an adolescent during the day. Can the curse of the male lead be lifted? What will happen next?
